class Solution(object):
    # 91的后续, 后面那个recursion版本也可以的，就是慢了点，思路完全一样，这个是数列版本
    # 典型的dp问题，自己做的，hard题
    def numDecodings(self, s):
        """
        :type s: str
        :rtype: int
        """
        mod = 10**9 + 7
        length = len(s)
        if length == 0:
            return 0
        elif s[0] == "0":
            return 0
        else:
            result = (length + 1) * [1] # 最后一个得是1，因为后面做的是乘法（排列组合问题）,0的话就毁了
            if s[length-1] == "*":
                result[length-1] = 9
            elif s[length-1] == "0":
                result[length-1] = 0
            else:
                result[length-1] = 1
            for i in xrange(length-2,-1,-1):
                if s[i] == "0":
                    value = 0
                elif s[i] in "12":
                    if s[i+1] == "0" or (s[i] == "2" and s[i+1] in "789"):
                        value = result[i+2]
                    elif s[i+1] == "*":
                        if s[i] == "1":
                            value = 9 * result[i+2] + result[i+1]
                        else:
                            value = 6 * result[i+2] + result[i+1]
                    else:
                        value = result[i+2] + result[i+1]
                elif s[i] == "*":
                    if s[i+1] in "123456":
                        value = 2 * result[i+2] + 9 * result[i+1]
                    elif s[i+1] == "0":
                        value = 2 * result[i+2]
                    elif s[i+1] != "*":
                        value = result[i+2] + 9 * result[i+1]
                    else:
                        value = 15 * result[i+2] + 9 * result[i+1]
                else:
                    value = result[i+1]
                value = value % mod
                result[i] = value
            return result[0]
